import React from "react";

const PlayDataView = (props) => {
    if (props.currentTab == "details") {
        return (
            <div className="container">
                <p>Likely date of composition: {props.play.likelyDate}</p>
                <p>Genre: {props.play.genre}</p>
                <p>Wiki Link: <a>{props.play.wiki}</a></p>
                <p>Gutenberg: <a>{props.play.gutenberg}</a></p>
                <p>Shakespeare.org Link: <a>{props.play.shakespeareOrg}</a></p>
                <p>Description:</p>
                <p>{props.play.desc}</p>
            </div>
        );
    }
    else {
        return (
            <div className="container">
                <p>Empty</p>
            </div>
        );
    }
};

export default PlayDataView
